import React from 'react'
import baner from "./slBANER.png"
import spinpoler from './spinpoler.png'
import Carousel from './HomePageCarousel';

const Home = () => {
  return (
    <div style={{ backgroundImage: `url("slBODY")`, height: '100vh', backgroundSize: 'cover' }}>
      <img src={baner}></img>
      
      <div></div>
      <img src={spinpoler} style={{marginLeft: '-22 px'}} />

      <Carousel />
      
    </div>
    
  )
}
export default Home;
